ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 4/2011, pela Deputada Luiza Erundina (PSB-SP), que: "Requer a realização de Audiência Pública para subsidiar o debate relativo à reforma política, com a presença das seguintes autoridades: · 
1) DAVID FLEISCHER, doutor em Ciência Política pela Universidade da Florida, Pós-Doutorado pela Universidade do Estado de Nova Iorque; professor emérito da Universidade de Brasília;
2) JOSÉ ANTÔNIO MORONI, filósofo pela Universidade Dom Bosco, membro do colegiado de gestão do Instituto de Estudos Socioeconômicos - Inesc; Secretario Nacional do Fórum Nacional de Participação Popular - FNPP, membro da Coordenação da Plataforma dos Movimentos Sociais pela Reforma do Sistema Político; 
3) FÁBIO KONDER COMPARATO, advogado, escritor e jurista; professor titular aposentado da Faculdade de Direito da Universidade de São Paulo - USP; doutor em Direito pela Universidade de Paris e doutor Honoris Causa pela Universidade de Coimbra; 
4) SONIA FLEURY, doutora em Ciência Política e mestre em Sociologia pelo Instituto Universitário de Pesquisas do Rio de Janeiro - IUPERJ e psicóloga pela Universidade Federal de Minas Gerais - UFMG; membro do Conselho do Desenvolvimento Econômico e Social da Presidência da República (2003-2006); professora titular da Fundação Getúlio Vargas.
".

descricao:
Aprovado, por unanimidade, o requerimento, com alterações.
ALTERAÇÕES: 1) para que a Audiência Pública seja realizada em conjunto com a Comissão Mista de Planos, Orçamentos Públicos e Fiscalização;
2) para que também seja tratado do Plano Plurianual de 2012 a 2015 a ser encaminhado pelo Poder Executivo;
3) para que o Requerimento seja desmembrado em Requerimento de Audiência Pública e Indicação ao Poder Executivo propondo a prorrogação do prazo estipulado no Decreto nº 7.418/10.

Aprovado, unanimemente, o requerimento, com alterações.
ALTERAÇÕES: 1) incluído, como convidado, um dos seguintes economistas: José Roberto Afonso ou Raul Veloso;
2) incluído o Presidente da Confederação Nacional de Municípios - CNM, Sr. Paulo Ziulkoski, em vez do Presidente da União dos Municípios da Bahia - UPB.

ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 44/2011, pelas Deputadas Erika Kokay (PT-DF) e Luci Choinacki (PT-SC), que: "Requer a realização de Audiência Pública para discutir medidas visando garantir que, no novo ordenamento político-eleitoral brasileiro, a ser instituído pela reforma política ora em debate, haja o efetivo respeito ao princípio da equidade de gênero, com os seguintes convidados:
- Deputada Nacional Adriana Puiggros, da Argentina;
- Ministra Iriny Lopes, da Secretaria Especial de Políticas para as Mulheres, da Presidência da República;
- Juíza aposentada Maria Lúcia Karam;
- Sra. Rosane da Silva, Secretaria de Política para as Mulheres da Central Única dos Trabalhadores;
- Sra. Maria Betânia Àvila, Membro da Articulação de Mulheres Brasileiras (AMB);
- Prof. José Antonio Moroni, do INESC- Instituto de Estudos Sócio-econômicos;
- Dra. Lourdes Bandeira, socióloga da Universidade de Brasília; e
- Sra. Guacira Cesár de Oliveira, diretora do CFEMEA- Centro Feminista de Estudos e Assessoria".

descricao:
Aprovada a inclusão dos seguintes convidados na reunião sobre pós-venda de aparelhos de telefonia móvel celular, em 4.5.2011:
. José Augusto de Souza Peres Filho, Presidente da Associação Nacional do Ministério Público do Consumidor - MPCON;
. Dario Bampa, Superintendente Executivo da Associação Brasileira da Indústria de Elétrica e Eletrônica - Abinee.

ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 43/2011, pelo Deputado Wilson Filho (PMDB-PB), que: "Solicita que seja realizado Seminário para debater as causas, conseqüências, responsabilidades e alternativas de enfrentamento às drogas, na Assembléia Legislativa do Estado da Paraíba - PB, com os seguintes convidados:  1) Presidente da  Assembléia Legislativa, Deputado Ricardo  Luís Barbosa de Lima Marcelo;  2) Deputadas Estaduais e Deputados Estaduais; 3)  Secretária de Estado de Desenvolvimento Humano, Dra. Maria Aparecida Ramos de Meneses; 4) Secretária Executiva de Desenvolvimento Humano, Sra. Edina Guedes Wanderley; 5) Secretário de Estado da Educação, Sr. Afonso Celso Caldeira Scocuglia; 6)  Secretária Executiva de Estado da Educação, Sra. Márcia de Figueirêdo Lucena Lira; 7)  Secretário da Saúde, Sr. Waldson Dias de Souza; 8)  Secretário de Estado da Segurança e da Defesa Social, Sr. Cláudio Coelho Lima;
9) Secretário Executivo da Segurança e da Defesa Social, Dr. Raimundo José Araújo Silvany; 10) Tribunal de Justiça - Presidente, Des. Abraham Lincoln da Cunha Ramos; 11)  Polícia Federal - Superintendência da Paraíba, DPF Sinomar Maria Neto; 12) Ministério Público - Vara da Infância e da Juventude, Promotora Dra. Soraya Soares da Nóbrega Scorel; 13)  OAB da Paraíba - Presidente, Dr. Odon Bezerra Cavalcanti Sobrinho;
14) Coordenador do Programa de Políticas Públicas de Combate às Drogas do Governo do Estado, Pastor João Filho; 15) Presidente da Comissão de Políticas Contra as Drogas da OAB, Dr. Deusimar Guedes Wanderlei; 16)  Universidade Federal de Campina Grande  - UFCG - Reitor, Doutor Thompson Fernandes Mariz;
17) Universidade Federal da Paraíba - UFPB - Reitor, Rômulo Soares Polari; 18) Universidade Estadual da Paraíba - UEPB - Reitora, Profª  Marlene Alves Sousa Luna; 19) Fundação Cidade Viva, Sr. José Marcelo; 20) Casa de Apoio Fazenda Esperança - Sr. Francisco Moraes Junior; 21) Centro de Recuperação de Jovem (CRJ) - Sr. Arides Samir; 22) UNE - Diretor de Políticas Institucionais da Paraíba , Sr. Ziolinton Albuquerque Maia; 23)  UBES - Diretora Regional, Marília França; 24) CUFA - Coordenadora Geral da Paraíba, Kalyne Lima; 25) Rotary Club de João Pessoa, Presidente Sra. Valquiria Braga; 26) Lions Club de Campina Grande, Sra. Ivanilda Bandeira; 27) Grande Loja  Maçônica do Estado da Paraíba, Grão Mestre Marcos Antonio de Araujo Leite; 28)  Arcebispo Metropolitano da Paraíba, Dom Aldo Di Cillo Pagotto; 29) Igreja Universal  - Força Jovem, Pastor Samir; 30) Igreja Batista, Pastor Estevão Fernandes".

Parecer do Relator, Dep. Francisco Praciano (PT-AM), pela aprovação, com emendas:
- Emenda nº 1, alterando a redação da ementa da proposição; 
- Emenda nº 2, alterando a redação do art. 1º da proposição;
- Emenda nº 3, alterando a redação do art. 2º da proposição;
- Emenda nº 4, suprimindo o art. 3º da proposição.
